import React from 'react';
function ListaActores(props) {

  

 
    return (
      <React.Fragment>
        <h1>Actores</h1>
        {/* {console.log(props.datos)}  */}
        {props.datos.length !== 0
          ? 
          props.datos.map((v, i, a) => {
            if(i< 10)
            return (
              <p
                key={i}
                onClick={() => {
                  props.funcion(v.url);
                }}
              >
                {v.name}
              </p>
            );
          })
          : ( <p className='alert'>No se han encontrado los Actores de esta película</p>)}
      </React.Fragment>
    );
  }
  
  export default ListaActores;
